import "./landing.css";
import React from "react";
import NavBar from  "../navbar/navbar.js";
import Footer from "../footer/footer.js";
import Typography from "@mui/material/Typography";
import {changeVisibility} from "../personal_util/display.ts";
import SchoolIcon from "@mui/icons-material/School";
import FeedIcon from "@mui/icons-material/Feed";
import ScienceIcon from "@mui/icons-material/Science";
import GestureIcon from "@mui/icons-material/Gesture";
import FlightTakeoffIcon from "@mui/icons-material/FlightTakeoff";
import WorkIcon from '@mui/icons-material/Work';
import EmailIcon from "@mui/icons-material/Email";
import Button from "@mui/material/Button";
import Stack from '@mui/material/Stack';
import Link from '@mui/material/Link';
import img2 from '../media/images/pic2.png';
import img3 from '../media/images/pic3.png';
import img4 from '../media/images/pic4.png';
import img16 from '../media/images/pic16.png';
import img15 from '../media/images/pic15.png';
import img7 from '../media/images/pic7.png';

const observer = new IntersectionObserver(entries => {
  entries.forEach(entry => {
    const square = entry.target.querySelector('.appear');

    if (entry.isIntersecting) {
      square.classList.add('appear');
	  return; // if we added the class, exit the function
    }

    // We're not intersecting, so remove the class!
    square.classList.remove('appear');
  });
});

function Landing() {
  observer.observe(document.querySelector('.appear'));
  const drawings = [img2, img16, img3, img4, img15, img7];
  return (
    <>
      <div id="root" className="width-100 flex column align-center">
        <NavBar />
        <div className="flex justify-around align-center width-100 profile appear">
          <div className="black profile-text flex column">
            <p className="font-65px heavy margin-0">HELLO</p>
            <p className="font-32px bold margin-0">I am Ahmed Katary</p>
            <p className="font-26px regular margin-0">Welcome to my slice of the web!</p>
          </div>
          <div className="circle sqr-300px flex align-center justify-center box-shadow-40">
            <div className="circle sqr-250px  flex align-center gray justify-center box-shadow-75">
              <div className="circle profile-image sqr-230px"></div>
            </div>
          </div>
        </div>
        <div className="map width-100 height-42vw appear"></div>
        {/** Art **/}
        <p className="font-32px bold black margin-10px">Art Gallery</p>
        <Stack direction="horizontal" className="width-100 slideshow scroll">
        {drawings.length > 0 ?
          drawings.map((item, index) => {
              return (<img className="box-shadow margin-5px enlarge pointer" height="300px" src={item} alt=""/>);
              }) :  <></>
        }
        </Stack>
        {/** Projects/Research **/}


        {/** Papers / Publications **/}


        {/** Education / Work **/}


        {/** Group Three: Travel **/}


        {/** Group Four: Contact **/}

        <Footer />
      </div>
    </>
  );
}

export default Landing;
